import React from 'react';
import GeoLocation from '../../helper/helperComponents/GeoLocation';

class LastPage extends React.Component {

   constructor(props) {
      super(props);
      state = {
         condition: true
      }

      render() 

         const helpSent = () => {
            alert("Help will be sent!")
         }

         const allowButton = () => {
            this.setState(!this.state)
         }

         return (
            <div>
               <h1>Let us get your location.</h1>
               <GeoLocation onClick={allowButton} />
               <button disabled={this.state} className="FirstPageButton" onClick={helpSent}>Submit</button>
            </div>
         );
      }
   }

   export default LastPage;
